    public static String plusMult(List<Integer> A) {
        int rEven = 0, rOdd = 0;
        int kEven = 0, kOdd = 0;

        for(int i = 0; i < A.size(); i++) {
            if(i % 2 == 0) {
                if(kEven % 2 == 0) {
                    rEven += A.get(i);
                } else {
                    rEven *= A.get(i);
                }
                kEven++;
            } else {
                if(kOdd % 2 == 0)
                    rOdd += A.get(i);
                else
                    rOdd *= A.get(i);
                kOdd++;
            }
        }

        rEven = rEven % 2;
        rOdd = rOdd % 2;

        rEven = rEven < 0 ? -rEven : rEven;
        rOdd = rOdd < 0 ? -rOdd : rOdd;

        if(rEven > rOdd) return "EVEN";
        else if(rEven < rOdd) return "ODD";
        else return "NEUTRAL";
    }
